import styled from 'styled-components';

export const Container = styled.div`
  background:var(--color-white);

  border-bottom:var(--color-border-top);




  >ul li{
    display:flex;
    justify-content:center;
    align-items:center;
    padding:2px;

    >span{
      padding-left:10px;
      display:flex;


    }

    }

`;


export const IconImage  = styled.img`
    height:154px;
    width:54px;
    display:flex;
    justify-content:center;
    align-items:center;

`;
